import React, { useState, useEffect } from 'react'
import { searchObjects, deleteObject } from '../utils/storage'

const PoliceSearchForm = ({ token, currentUser }) => {
  const [searchResults, setSearchResults] = useState([])

  const handleSearch = async () => {
    const data = await searchObjects(token)
    setSearchResults(data)
  }

  const handleDelete = async id => {
    if (window.confirm('¿Seguro que querés eliminar este objeto?')) {
      await deleteObject(id, token)
      handleSearch()
    }
  }

  useEffect(() => {
    handleSearch()
  }, [])

  return (
    <div className="mt-6">
      <h2 className="text-lg font-bold mb-2">Objetos registrados</h2>
      <button onClick={handleSearch} className="mb-2 bg-blue-500 text-white px-3 py-1 rounded">
        Actualizar
      </button>
      <ul className="space-y-2">
        {searchResults.map(item => (
          <li key={item._id} className="border p-2 rounded bg-gray-100">
            <strong>{item.type}</strong> - {item.brand} - {item.model}
            {currentUser === 'GustavoPeralta' && (
              <button onClick={() => handleDelete(item._id)} className="ml-2 bg-red-500 text-white px-2 py-1 rounded">
                Eliminar
              </button>
            )}
          </li>
        ))}
      </ul>
    </div>
  )
}

export default PoliceSearchForm
